import React from "react";
import "../../App.css";
import Footer from "../Footer";

export default function Partners() {
  const outerClasses = classNames(
    "testimonial section",
    topOuterDivider && "has-top-divider",
    bottomOuterDivider && "has-bottom-divider",
    hasBgColor && "has-bg-color",
    invertColor && "invert-color",
    className
  );

  const innerClasses = classNames(
    "testimonial-inner section-inner",
    topDivider && "has-top-divider",
    bottomDivider && "has-bottom-divider"
  );

  const tilesClasses = classNames(
    "tiles-wrapPartners",
    pushLeft && "push-left"
  );

  const sectionHeader = {
    title: "Partners",
  };
  return (
    <>
      <h1 className="products">Partners</h1>
      <div>
        <div
          className={tilesClasses}
          style={{
            maxWidth: "100%",
            display: "flex",
            flexDirection: "row",
            margin: "0px",
            justifyContent: "space-between",
            height: "100%",
          }}
        >
          <div
            className="reveal-from-right"
            data-reveal-delay="200"
            style={{
              maxWidth: "90%",
              display: "flex",
              justifyContent: "flex-start",
            }}
          >
            <div
              className="tiles-item-inner"
              style={{ maxWidth: "98%", backgroundColor: "white" }}
            >
              <div>
                <img src={cutra} alt="" />
              </div>
              <div
                className="testimonial-item-footer text-xs mt-32 mb-0 has-top-divider"
                style={{
                  maxWidth: "100%",
                  display: "flex",
                  justifyContent: "space-between",
                }}
              >
                <span className="testimonial-item-name text-color-low">
                  CUTRAARCHITEKTEN
                </span>
                <span className="testimonial-item-link">
                  <a href="https://cutraarchitekten.ch/" target="_blank">
                    cutraarchitekten.ch
                  </a>
                </span>
              </div>
            </div>
          </div>

          <div
            className="reveal-from-right"
            data-reveal-delay="200"
            style={{
              maxWidth: "100%",
              height: "100%",
              display: "flex",
              justifyContent: "flex-end",
            }}
          >
            <div
              className="tiles-item-inner"
              style={{
                maxWidth: "98%",
                backgroundColor: "white",
                height: "100%",
                margin: "0px",
              }}
            >
              <div>
                <img src={edness} alt="" />
              </div>
              <div
                className="testimonial-item-footer text-xs mt-32 mb-0 has-top-divider"
                style={{
                  maxWidth: "100%",
                  display: "flex",
                  justifyContent: "space-between",
                }}
              >
                <span className="testimonial-item-name text-color-low">
                  EDNESS VERSICHERUNGSTREUHAND
                </span>
                <span className="testimonial-item-link">
                  <a href="https://edness.ch/" target="_blank">
                    edness.ch
                  </a>
                </span>
              </div>
            </div>
          </div>
        </div>
      </div>
      <div>
        <Footer />
      </div>
    </>
  );
}
